  handleClick = async () => {
    const result = await axios.get("/list", {
      headers: {
        "Access-Control-Allow-Origin": "*",
      },
    });
    console.log(result);
  };

  render() {
    return (
      <div>
        <Table />
        <button onClick={this.handleClick}>Click</button>
      </div>
    );
  }
}

export default Champion;
